import "./banner.css";
export default function Baner() {
  return (
    <>
    <section className='header'>
      <h1>Welcome To My Website</h1>
      <h4>i'm Farhan Amin </h4>
      <h6 className='btn-bgstroke'> Contact Me</h6>
    </section>
    </>
  )
}
